import React from 'react';

const VideoDetail = ({selectedVideo}) => {
    if(selectedVideo) {
        return (
            <div>{selectedVideo.snippet.thumbnails.medium.url}</div>
        )
    } else {
        return (
            <div>No video selected</div>
        )
    }

}

export default VideoDetail;
